import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.use(VueRouter);

const routes = [
  // {
  //   path: '/',
  //   name: 'Home',
  //   redirect: '/my-setting/index'
  // },
  {
    path: '/ding-login', // 登录入口
    name: 'ding-login',
    meta: {
      title: '登录中...'
    },
    component: () =>
      import(/* webpackChunkName: "ding-login" */ '../views/ding-login.vue'),
    props: route => ({
      redirect: route.query.redirect
    })
  },
  {
    path: '*',
    name: 'NotFound',
    component: () =>
      import(
        /* webpackChunkName: "teaching-points-h5-not-found" */
        '../views/common/NotFound.vue'
      )
  },
  {
    path: '/teaching-activity/index',
    name: 'teachingActivity',
    meta: {
      title: '教研活动'
    },
    component: () =>
      import(
        /* webpackChunkName: "teachingActivity" */
        '../views/teaching-activity/index'
      )
  },
  {
    path: '/teaching-activity/activityDetailsAdd',
    name: 'activityDetailsAdd',
    meta: {
      title: '活动新建',
      cache: true
    },
    component: () =>
      import(
        /* webpackChunkName: "activityDetailsAdd" */
        '../views/teaching-activity/activityDetailsAdd'
      )
  },
  {
    path: '/teaching-activity/activityDetailsEdit',
    name: 'activityDetailsEdit',
    meta: {
      title: '活动编辑',
      cache: true
    },
    component: () =>
      import(
        /* webpackChunkName: "activityDetailsEdit" */
        '../views/teaching-activity/activityDetailsAdd'
      )
  },
  {
    path: '/teaching-activity/activitySign',
    name: 'activitySign',
    meta: {
      title: '签到'
    },
    component: () =>
      import(
        /* webpackChunkName: "activitySign" */
        '../views/teaching-activity/activitySign'
      )
  },
  {
    path: '/teaching-activity/memberDetails',
    name: 'memberDetails',
    meta: {
      title: '成员'
    },
    component: () =>
      import(
        /* webpackChunkName: "memberDetails" */
        '../views/teaching-activity/memberDetails'
      )
  },
  {
    path: '/teaching-activity/signedDetails',
    name: 'signedDetails',
    meta: {
      title: '签到'
    },
    component: () =>
      import(
        /* webpackChunkName: "signedDetails" */
        '../views/teaching-activity/signedDetails'
      )
  },
  {
    path: '/teaching-activity/activityTableSelector',
    name: 'activityTableSelector',
    meta: {
      title: '选择负责人'
    },
    component: () =>
      import(
        /* webpackChunkName: "activityTableSelector" */
        '../views/teaching-activity/tableSelector'
      )
  },
  {
    path: '/teaching-activity/searchActivity',
    name: 'searchActivity',
    meta: {
      title: '活动搜索'
    },
    component: () =>
      import(
        /* webpackChunkName: "teachingActivity" */
        '../views/teaching-activity/searchActivity'
      )
  },
  {
    path: '/teaching-activity/searchPlan',
    name: 'searchPlan',
    meta: {
      title: '计划搜索'
    },
    component: () =>
      import(
        /* webpackChunkName: "searchPlan" */
        '../views/teaching-activity/searchPlan'
      )
  },
  {
    path: '/teaching-activity/activityDetails',
    name: 'activityDetails',
    meta: {
      title: '活动详情'
    },
    component: () =>
      import(
        /* webpackChunkName: "activityDetails" */
        '../views/teaching-activity/activityDetails'
      )
  },
  {
    path: '/teaching-activity/meetingDetails', // /testPage/:aaa/:bbb
    name: 'meetingDetails',
    meta: {
      title: '会议纪要'
    },
    component: () =>
      import(
        /* webpackChunkName: "meetingDetails" */
        '../views/teaching-activity/meetingDetails'
      )
  },
  {
    path: '/teaching-activity/achievementDetails',
    name: 'achievementDetails',
    meta: {
      title: '成果展示',
      cache: true
    },
    component: () =>
      import(
        /* webpackChunkName: "achievementDetails" */
        '../views/teaching-activity/achievementDetails'
      )
  },

  {
    path: '/teaching-activity/planDetails',
    name: 'planDetails',
    meta: {
      title: '计划详情'
    },
    component: () =>
      import(
        /* webpackChunkName: "planDetails" */
        '../views/teaching-activity/planDetails'
      )
  },

  {
    path: '/teaching-activity/planDetailsAdd',
    name: 'planDetailsAdd',
    meta: {
      title: '新建计划',
      cache: true
    },
    component: () =>
      import(
        /* webpackChunkName: "planDetailsAdd" */
        '../views/teaching-activity/planDetailsAdd'
      )
  },

  {
    path: '/teaching-activity/planDetailsEdit',
    name: 'planDetailsEdit',
    meta: {
      title: '编辑计划',
      cache: true
    },
    component: () =>
      import(
        /* webpackChunkName: "planDetailsEdit" */
        '../views/teaching-activity/planDetailsAdd'
      )
  },

  {
    path: '/teaching-activity/selectPage',
    name: 'selectPage',
    meta: {
      title: '选择学校'
    },
    component: () =>
      import(
        /* webpackChunkName: "selectPage" */
        '../views/teaching-activity/selectPage'
      )
  },
  {
    path: '/normal-examine/index',
    name: 'normalExamine',
    meta: {
      title: '常规检查',
      requiresAuth: true
    },
    component: () =>
      import(
        /* webpackChunkName: "normalExamine" */
        '../views/normal-examine/index'
      )
  },
  {
    path: '/normal-examine/search',
    name: 'normalExamineSearch',
    meta: {
      title: '搜索'
    },
    component: () =>
      import(
        /* webpackChunkName: "normalExamineSearch" */
        '../views/normal-examine/search'
      )
  },
  {
    path: '/normal-examine/table-selector',
    name: 'tableSelector',
    meta: {
      title: '选择老师'
    },
    component: () =>
      import(
        /* webpackChunkName: "tableSelector" */
        '../views/normal-examine/components/tableSelector'
      )
  },
  {
    path: '/normal-examine/list-selector',
    name: 'listSelector',
    meta: {
      title: '选择学校'
    },
    component: () =>
      import(
        /* webpackChunkName: "listSelector" */
        '../views/normal-examine/components/listSelector'
      )
  },
  {
    path: '/normal-examine/bk-detail',
    name: 'bkDetail',
    meta: {
      title: '备课详情'
    },
    component: () =>
      import(
        /* webpackChunkName: "bkDetail" */
        '../views/normal-examine/bk-detail'
      )
  },
  {
    path: '/normal-examine/bk-edit',
    name: 'bkEdit',
    meta: {
      title: '新建/编辑备课'
    },
    component: () =>
      import(
        /* webpackChunkName: "bkEdit" */
        '../views/normal-examine/bk-edit'
      )
  },
  {
    path: '/normal-examine/gz-detail',
    name: 'gzDetail',
    meta: {
      title: '改作详情'
    },
    component: () =>
      import(
        /* webpackChunkName: "gzDetail" */
        '../views/normal-examine/gz-detail'
      )
  },
  {
    path: '/normal-examine/gz-edit',
    name: 'gzEdit',
    meta: {
      title: '新建/编辑改作'
    },
    component: () =>
      import(
        /* webpackChunkName: "gzEdit" */
        '../views/normal-examine/gz-edit'
      )
  },
  {
    path: '/normal-examine/tk-detail',
    name: 'tkDetail',
    meta: {
      title: '听课记录详情'
    },
    component: () =>
      import(
        /* webpackChunkName: "tkDetail" */
        '../views/normal-examine/tk-detail'
      )
  },
  {
    path: '/normal-examine/tk-edit',
    name: 'tkEdit',
    meta: {
      title: '新建/编辑听课'
    },
    component: () =>
      import(
        /* webpackChunkName: "tkEdit" */
        '../views/normal-examine/tk-edit'
      )
  },
  {
    path: '/course-research/preview',
    name: 'courseResearchPreview',
    meta: {
      title: '预览'
    },
    component: () =>
      import(
        /* webpackChunkName: "courseResearchPreview" */
        '../views/course-research/preview'
      )
  },
  {
    path: '/course-research/index',
    name: 'courseResearch',
    meta: {
      title: '教学研究'
    },
    component: () =>
      import(
        /* webpackChunkName: "courseResearch" */
        '../views/course-research/index'
      )
  },
  {
    path: '/course-research/search',
    name: 'courseResearchSearch',
    meta: {
      title: '搜索'
    },
    component: () =>
      import(
        /* webpackChunkName: "courseResearchSearch" */
        '../views/course-research/search'
      )
  },
  {
    path: '/course-research/task',
    name: 'courseResearchTask',
    meta: {
      title: '课题研究'
    },
    component: () =>
      import(
        /* webpackChunkName: "courseResearchTask" */
        '../views/course-research/task'
      )
  },
  {
    path: '/course-research/thesis',
    name: 'courseResearchThesis',
    meta: {
      title: '论文'
    },
    component: () =>
      import(
        /* webpackChunkName: "courseResearchThesis" */
        '../views/course-research/thesis'
      )
  },
  {
    path: '/teacher-points/index',
    name: 'teacherPoints',
    meta: {
      title: '教师积分'
    },
    component: () =>
      import(
        /* webpackChunkName: "teacherPoints" */
        '../views/teacher-points/index.vue'
      )
  },
  {
    path: '/teacher-points/search',
    name: 'teacherPointsSearch',
    meta: {
      title: '搜索'
    },
    component: () =>
      import(
        /* webpackChunkName: "normalExamineSearch" */
        '../views/teacher-points/search.vue'
      )
  },
  {
    path: '/teacher-points/add',
    name: 'teacherPointsAdd',
    meta: {
      title: ''
    },
    component: () =>
      import(
        /* webpackChunkName: "teacherPoints" */
        '../views/teacher-points/add'
      )
  },
  {
    path: '/teacher-points/addOption',
    name: 'teacherPointsAddOption',
    meta: {
      title: ''
    },
    component: () =>
      import(
        /* webpackChunkName: "teacherPoints" */
        '../views/teacher-points/addOption'
      )
  },
  {
    path: '/my-setting/index',
    name: 'mySetting',
    meta: {
      title: '我的'
    },
    component: () =>
      import(
        /* webpackChunkName: "mySetting" */
        '../views/my-setting/index'
      )
  }
];

// 测试登录页面
routes.push({
  path: '/test-login', // 测试登录
  name: 'test-login',
  component: () => import('../views/test-login.vue')
});

const router = new VueRouter({
  mode: 'history',
  base: process.env.VUE_APP_PUBLIC_PATH + 'teaching-points-h5',
  routes
});

router.beforeEach((to, from, next) => {
  document.title = to.meta.title || '教学科研平台';
  if (from.query.dd_nav_bgcolor) {
    //路由切换时，如果没有就添加，有就跳过执行，添加固定参数
    if (!to.query.dd_nav_bgcolor) {
      //准备一个跳转的query对象
      let query = to.query;
      query['dd_nav_bgcolor'] = 'FF489EF3';
      // console.log(query.dd_nav_bgcolor);
      if (query.dd_nav_bgcolor) {
        next({
          name: to.name,
          query: query,
          params: to.params
        });
      } else {
        next();
      }
    } else {
      next();
    }
  } else {
    next();
  }
});

export default router;
